import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';

import Button from '../../../common/button/Button'

import styles from './NavLinks.module.css';

const navSections = () => {
    return (
        <ul id={styles.navSections}> 
            <li><Link smooth to="../App/App#about">About</Link></li>
            <li><Link smooth to="../App/App#projects">Projects</Link></li>
            <li><Link smooth to="../App/App#career">Career</Link></li>
            <li><Link smooth to="../App/App#contact">Contact</Link></li>
            <span id={styles.resumeButton}>
                <Button>Resume</Button>
            </span>
        </ul>
    )
} 

export default navSections;
